import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  const token = localStorage.getItem('token');
  const ruolo = token ? JSON.parse(atob(token.split('.')[1])).ruolo : null;

  return (
    <nav style={{ padding: '1rem', background: '#eee' }}>
      <Link to="/">üè† Home</Link>{' | '}
      <Link to="/richieste-pubbliche">üîç Richieste Pubbliche</Link>{' | '}
      {token ? (
        <>
          <Link to="/home">Dashboard</Link>{' | '}
          <Link to="/mie-richieste">Le mie richieste</Link>{' | '}
          <Link to="/nuova-richiesta">Nuova richiesta</Link>{' | '}
          <Link to="/login" onClick={() => localStorage.removeItem('token')}>Logout</Link>
        </>
      ) : (
        <>
          <Link to="/login">Login</Link>{' | '}
          <Link to="/register">Registrati</Link>
        </>
      )}
    </nav>
  );
};

export default Navbar;
